import React from 'react'
import Header from '../Home/Header/Header'
import './home.css'

function Home() {
    return (
        <div className='home'>
            <Header />
            <h2 style={{margin:'auto',display:'flex'}}>Récup’ Retard</h2>
            <h4 style={{margin:'auto',display:'flex'}}>En cas de retard, ne passez plus à côté d’une compensation : nous facilitons votre demande. En savoir plus</h4>

        </div>
    )
} 

export default Home
